import React, { Component } from 'react';
import Provider from '@react/react-spectrum/Provider';
import ProtoShell from '../Components/Shell';
import ProtoNav from './Components/SideNav';
import ProtoTableView from '../Components/TableView';
import ProtoHeader from '../Components/Breadcrumb';
import { BrowserRouter as Router, Route, Link, Switch } from "react-router-dom";

class App extends Component {
  render() {
    return (
      <Provider theme='light' style={{"backgroundColor": "rgb(245, 245, 245)", "height":"calc=(100vh - 52px)"}}>


            <ul>
              <li>
                <Link to="/">Home</Link>
              </li>
              <li>
                <Link to="/users">Users</Link>
              </li>
              <li>
                <Link to="/contact">Contact</Link>
              </li>
            </ul>
      </Provider>
    );
  }
}

export default App;
